  false,\n\t\"url\": null,\n\t\"notes\": \"The global precipitation time series provides
  time series charts showing observations of daily precipitation as well as accumulated
  precipitation compared to normal accumulated amounts for various stations around
  the world. These charts are created for different scales of time (30, 90, 365 days).
  Each station has a graphic that contains two charts. The first chart in the graphic
  is a time series in the format of a line graph, representing accumulated precipitation
  for each day in the time series compared to the accumulated normal amount of precipitation.
  The second chart is a bar graph displaying actual daily precipitation. The total
  accumulation and surplus or deficit amounts are displayed as text on the charts
  representing the entire time scale, in both inches and millimeters. The graphics
  are updated daily and the graphics reflect the updated observations and accumulated
  precipitation amounts including the latest daily data available. The available graphics
  are rotated, meaning that only the most recently created graphics are available.
  Previously made graphics are not archived.\",\n\t\"license_title\": \"License Not
